import React from 'react';
import '../LandingPage/jumbotron.css'


const Jumbotron = () => {
    return (
        <div>
            <div class="jumbotron jumbotron-fluid">
                <h2 class="display-4">Let's Play</h2>
                <a href="#" role="button">Book Now</a>
            </div>
        </div>
    )
}

export default Jumbotron
